webpackJsonp([67],{HW02:function(o,e){o.exports='<h1 id="contributing">Contributing</h1>\n<p>&#x1F44D;&#x1F389; First off, thanks for taking the time to contribute! &#x1F389;&#x1F44D;</p>\n<h2 id="playground-issue-reports">Playground &amp; Issue Reports</h2>\n<p>If you want to play with BootstrapVue components without any local setup just head to\n<a href="https://bootstrap-vue.js.org/play">OnlinePlayground</a> and you can interactively play and test components with a fresh Vue instance.\nIf you want to keep your changes or make PRs reporting a component&apos;s misbehaviour you can save them in JSFiddle and provide that link in issues.</p>\n<h2 id="setup">Setup</h2>\n<ul>\n<li>Clone this repo (<code>git clone https://github.com/bootstrap-vue/bootstrap-vue --branch=dev</code>)</li>\n<li>Make sure you have node &amp; yarn installed locally.</li>\n<li><code>cd bootstrap-vue</code></li>\n<li>Run <code>yarn install</code> to get all dependencies installed.</li>\n</ul>\n<h2 id="work-on-components">Work on components</h2>\n<p>If you want to hack and improve components locally, you can follow these steps:</p>\n<ul>\n<li>Run <code>yarn docs-dev</code> to run a local development server.</li>\n<li>Head to <code>http://localhost:3000/play</code>.</li>\n<li>Now you can locally make changes to components (they are located in the <code>components</code> directory). \nChanges will be applied with webpack hot-reloading without needing to reload the page.</li>\n<li>Finally feel free to share your awesome hacks with others and opening a PR.</li>\n</ul>\n<h2 id="test-inside-your-project">Test inside your project</h2>\n<p>If you want to see your changes in your project instead of the playground:</p>\n<ul>\n<li>Execute <code>yarn link</code> inside <em>bootstrap-vue</em> directory.</li>\n<li>In your project run <code>yarn link bootstrap-vue</code></li>\n<li>Run <code>yarn watch</code> inside <em>bootstrap-vue</em></li>\n<li>Now every time you change a component, a new production version will be built and ready on your project. </li>\n</ul>\n<h2 id="pull-requests">Pull requests</h2>\n<p>Please ensure all pull requests related to <code>v1.x</code> are made aganst the <code>dev</code> branch on GitHub.\nSee <a href="https://github.com/conventional-changelog/standard-version">standard-version</a> for commit\nguidelines and PR naming conventions.</p>\n<h2 id="financial-contributions">Financial contributions</h2>\n<p>We also welcome financial contributions in full transparency on our <a href="https://opencollective.com/bootstrap-vue">open collective</a>.\nAnyone can file an expense. If the expense makes sense for the development of the community, it will be &quot;merged&quot; in the ledger of our open collective by the core contributors and the person who filed the expense will be reimbursed.</p>\n<h2 id="credits">Credits</h2>\n<h3 id="contributors">Contributors</h3>\n<p>Thank you to all the people who have already contributed to bootstrap-vue!\n<a href="graphs/contributors"><img src="https://opencollective.com/bootstrap-vue/contributors.svg?width=890"></a></p>\n<h3 id="backers">Backers</h3>\n<p>Thank you to all our backers! [<a href="https://opencollective.com/bootstrap-vue#backer">Become a backer</a>]</p>\n<p><a href="https://opencollective.com/bootstrap-vue#backers" target="_blank"><img src="https://opencollective.com/bootstrap-vue/backers.svg?width=890"></a></p>\n<h3 id="sponsors">Sponsors</h3>\n<p>Thank you to all our sponsors! (please ask your company to also support this open source project by <a href="https://opencollective.com/bootstrap-vue#sponsor">becoming a sponsor</a>)</p>\n<p><a href="https://opencollective.com/bootstrap-vue/sponsor/0/website" target="_blank"><img src="https://opencollective.com/bootstrap-vue/sponsor/0/avatar.svg"></a>\n<a href="https://opencollective.com/bootstrap-vue/sponsor/1/website" target="_blank"><img src="https://opencollective.com/bootstrap-vue/sponsor/1/avatar.svg"></a>\n<a href="https://opencollective.com/bootstrap-vue/sponsor/2/website" target="_blank"><img src="https://opencollective.com/bootstrap-vue/sponsor/2/avatar.svg"></a>\n<a href="https://opencollective.com/bootstrap-vue/sponsor/3/website" target="_blank"><img src="https://opencollective.com/bootstrap-vue/sponsor/3/avatar.svg"></a>\n<a href="https://opencollective.com/bootstrap-vue/sponsor/4/website" target="_blank"><img src="https://opencollective.com/bootstrap-vue/sponsor/4/avatar.svg"></a>\n<a href="https://opencollective.com/bootstrap-vue/sponsor/5/website" target="_blank"><img src="https://opencollective.com/bootstrap-vue/sponsor/5/avatar.svg"></a>\n<a href="https://opencollective.com/bootstrap-vue/sponsor/6/website" target="_blank"><img src="https://opencollective.com/bootstrap-vue/sponsor/6/avatar.svg"></a>\n<a href="https://opencollective.com/bootstrap-vue/sponsor/7/website" target="_blank"><img src="https://opencollective.com/bootstrap-vue/sponsor/7/avatar.svg"></a>\n<a href="https://opencollective.com/bootstrap-vue/sponsor/8/website" target="_blank"><img src="https://opencollective.com/bootstrap-vue/sponsor/8/avatar.svg"></a>\n<a href="https://opencollective.com/bootstrap-vue/sponsor/9/website" target="_blank"><img src="https://opencollective.com/bootstrap-vue/sponsor/9/avatar.svg"></a></p>\n'}});
